export default function getListStudentIds (array) {
  let list = [];
  if (Array.isArray(array)) {
    let index = 0;
    while (index < array.length) {
      const id = array[index].id
      list[index] = id
      index += 1
    }
  } else {
    return list
  }
  return list;
}
